// --- PEGANDO VARIÁVEIS DIRETAMENTE DO NODE 'Supabase19' ---
// Tentamos pegar as variáveis de forma segura. Se o nó Supabase19 não tiver esses campos,
// eles serão undefined, e as conversões/validações abaixo lidarão com isso.
const itemSupabase = $('Supabase19').first().json;

// Extração e conversão de valores para números.
// Number() tentará converter e retornará NaN se não for um número válido.
const peso = Number(itemSupabase.peso);
const altura = Number(itemSupabase.altura);
const idade = Number(itemSupabase.idade);

// Variáveis que podem ser strings. Usamos || "" para garantir que sejam strings vazias se undefined.
// .toLowerCase() para padronizar as entradas.
const sexo = (itemSupabase.sexo || "").toLowerCase();
const objetivo = 'emagrecer';

// parseInt() para nível de atividade. Usamos 10 para base decimal.
// Se não for um número válido, será NaN, o que será tratado na validação.
const nivelAtividadeInput = parseInt(itemSupabase.nivel_atividade, 10);
let nivelAtividade = 2; // Valor padrão caso a entrada seja inválida ou fora da faixa

// --- VALIDAÇÃO DE ENTRADAS CRÍTICAS ---
// Retorna um erro se qualquer dado essencial for inválido.

// 1. Validação de peso, altura, idade
if (isNaN(peso) || peso <= 0 ||
    isNaN(altura) || altura <= 0 ||
    isNaN(idade) || idade <= 0) {
  return [
    {
      json: {
        erro: "Erro: Peso, altura ou idade inválidos. Certifique-se de que são números positivos."
      }
    }
  ];
}

// 2. Validação de sexo
if (sexo !== "masculino" && sexo !== "feminino") {
  return [
    {
      json: {
        erro: "Erro: Sexo inválido. Use 'masculino' ou 'feminino'."
      }
    }
  ];
}

// 3. Validação de objetivo
// Adicionando um array de objetivos válidos para validação mais robusta
const objetivosValidos = ["emagrecer", "manter", "ganhar"];
if (!objetivosValidos.includes(objetivo)) {
  return [
    {
      json: {
        erro: `Erro: Objetivo inválido. Use um dos seguintes: ${objetivosValidos.join(', ')}.`
      }
    }
  ];
}

// 4. Validação e ajuste de Nível de Atividade
// Se o nível de atividade do input for um número válido e dentro da faixa, use-o.
// Caso contrário, o 'nivelAtividade' já está definido como 2 (padrão).
if (!isNaN(nivelAtividadeInput) && nivelAtividadeInput >= 1 && nivelAtividadeInput <= 5) {
  nivelAtividade = nivelAtividadeInput;
} else {
    // Podemos retornar um aviso aqui ou apenas usar o padrão sem erro fatal
    // console.warn("Aviso: Nível de atividade inválido. Usando o valor padrão (2 - atividade leve).");
}

// --- FATORES DE ATIVIDADE (PARA CÁLCULO DO GET) ---
const fatoresAtividade = {
  1: 1.2,    // Sedentário
  2: 1.375,  // Levemente Ativo (1-3 dias/semana)
  3: 1.55,   // Moderadamente Ativo (3-5 dias/semana)
  4: 1.725,  // Muito Ativo (6-7 dias/semana)
  5: 1.9     // Extremamente Ativo (Atletas, 2x ao dia)
};

// --- CÁLCULO DA TMB (TAXA METABÓLICA BASAL) ---
let tmb = 0;
if (sexo === "masculino") {
  tmb = (10 * peso) + (6.25 * altura) - (5 * idade) + 5;
} else { // sexo === "feminino" (já validado)
  tmb = (10 * peso) + (6.25 * altura) - (5 * idade) - 161;
}

// --- CÁLCULO DO GET (GASTO ENERGÉTICO TOTAL) ---
// Usa o fator de atividade correspondente, ou 1.2 (sedentário) como fallback.
const fatorAtividadeAplicado = fatoresAtividade[nivelAtividade] || 1.2;
let calorias = tmb * fatorAtividadeAplicado;

// --- AJUSTE DE CALORIAS PELO OBJETIVO ---
if (objetivo === "emagrecer") {
  calorias *= 0.8; // Reduz em 20%
} else if (objetivo === "ganhar") {
  calorias *= 1.15; // Aumenta em 15%
}
calorias = Math.round(calorias); // Arredonda para o número inteiro mais próximo

// --- CÁLCULO DOS MACRONUTRIENTES ---
let proteinaPorKg = 2.0; // Padrão
let gorduraPorKg = 0.8;  // Padrão

if (objetivo === "emagrecer") {
  proteinaPorKg = 2.2; // Maior para emagrecimento
  gorduraPorKg = 0.7;  // Menor para emagrecimento
} else if (objetivo === "ganhar") {
  proteinaPorKg = 2.0; // Mantém
  gorduraPorKg = 1.0;  // Um pouco mais para ganho
}

const proteinas = Math.round(proteinaPorKg * peso);
const kcalProteinas = proteinas * 4; // 1g Proteína = 4 kcal

const gorduras = Math.round(gorduraPorKg * peso);
const kcalGorduras = gorduras * 9; // 1g Gordura = 9 kcal

// Carboidratos preenchem o restante das calorias
const kcalRestantesParaCarboidratos = calorias - (kcalProteinas + kcalGorduras);
// Garante que carboidratos não sejam negativos
const carboidratos = Math.max(0, Math.round(kcalRestantesParaCarboidratos / 4)); // 1g Carboidrato = 4 kcal

// --- RETORNO DOS RESULTADOS ---
// O N8N espera um array de objetos, onde cada objeto tem uma propriedade 'json'.
return [
  {
    json: {
      peso,
      altura,
      idade,
      sexo,
      objetivo,
      nivelAtividade, // Nível de atividade final (pode ser o padrão 2)
      tmb: Math.round(tmb), // Arredonda TMB para facilitar a leitura
      fatorAtividadeAplicado, // O fator usado para o cálculo do GET
      calorias, // Este é o GET final ajustado
      proteinas,
      carboidratos,
      gorduras,
      // Opcional: retornar as calorias de cada macronutriente para verificação
      kcalProteinas,
      kcalGorduras,
      kcalCarboidratos: carboidratos * 4 // Calorias dos carboidratos
    }
  }
];
